import React from "react";
import './styles/home.css'
import Login from "./login"

export class Home extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <div className="container" id="container">
            <div className="form-container sign-up-container">
                <Login/>
            </div>

            <div className="form-container sign-in-container">
                <form onSubmit="#">
                    <h1>Sign in</h1>
                    <div className="social-container">
                        <a href="#" className="social"><i className="fab fa-facebook-f"></i></a>
                        <a href="#" className="social"><i className="fab fa-google-plus-g"></i></a>
                        <a href="#" className="social"><i className="fab fa-linkedin-in"></i></a>
                    </div>
                    <span>Or use your account</span>
                    <input type="email" placeholder="Email" onChange={(e) => (this.correo = e.target.value)}/>
                    <input type="password" placeholder="Password" onChange={(e) => (this.contraseña = e.target.value)}/>
                    <a href="#">Forgot your password?</a>
                    <button type="submit">Sign in</button>
                </form>
            </div>

            <div className="overlay-container">
                <div className="overlay">

                    <div className="overlay-panel overlay-left">
                        <h1>Welcome Back!</h1>
                        <p>
                            To Keep connected with us please login with you personal info.
                        </p>
                        <button className="ghost" id="signIn" onClick={() => {
	                        document.getElementById('container').classList.remove("right-panel-active");
                        }}>Sign in</button>
                    </div>

                    <div className="overlay-panel overlay-right">
                        <h1>Hello, Friend!</h1>
                        <p>
                            Enter your personal details and start journey with us.
                        </p>
                        <button className="ghost" id="signUp" onClick={() => {
                            document.getElementById('container').classList.add("right-panel-active");
                            }}>Sign up</button>
                    </div>
                </div>
            </div>
        </div>
        
    );
  }
}
